message:
Possiveis batalhas:
Sanji zoro vs comandantes e voadores;
Ussop chopper vs numbers;
Jimbe franky robin e nami e brook vs a VEIA;
Ser um chapeu de batalha significa cagar para a veia;
Brook  franky e jimbe tao nem ai para oque a veia é;
ninquem respeita a veia;
a veia vai acabar virando uma piada comica kkkkkkkkkk
Aposto que a bigmom acaba perdendo o posto de yonkou assim kkkkkk

Próximo capítulo: Marco e Perospero chegando;
Sasaki, Who who, Black Maria e Page 1 também;
CP se infiltrando;
Fusão da Big Mom com Zeus, Napoleon e Prometheus.
Assim espero!!

Capitulo espetacular
-Ignorar a historia de capa do Pound;
-Yamato 0 de QI;
-A fala do Franky  foi bem foda, mas a Nami ainda ta certa, ela viu  de perto o que um Yonkou é  capaz e ela praticamente  não  tem resistencia pra aguentar nem tapa de smile, então  é bastante compreensível  ela ter medo;
-Muito bom ver que a Robin e o Jimbe estão  fazendo um otimo trabalho em equipe;
-Big mon em vez de balão de ferro virou uma bola de ferro kkkkk;
-Eu gostei bastante do design  dos numbers, achei daora também  a explicação  por trás  deles, esperava ser de uma raça  própria, mas ta valendo;
-Queen interagindo com o seu futuro capitão( #QueenMugiwara🦕👒);
-Pelo visto King não teve dificuldades com o Sanji msm(Cadê  tu Marco?);
-Ver o bando todo reunido me deixa feliz, seria bom  se no prox capitulo tivéssemos pagina dupla dos piratas das feras+BM.

Eu e um amigo conversamos e ja faz um tempinho que a BM não  tilta por causa da larica, talvez ela acabe tiltando ai e o Perospero apareça  pra tentar tirar ela de vista.
